import styled from 'styled-components'
import * as appStyle from '../appStyle'

export const LocationWrap = styled.div`
    display : flex;
    position : fixed;
    background-color : white;
    bottom: 0;
    top: 160px;
    left: 400px;
    right : 400px;
    z-index : 10;
    padding : 40px;
    border-radius : 8px 8px 0px 0px;
`
